import React, {
	Component
} from 'react';

export default class Input extends Component {
	constructor(props){
		super(props)
    this.props.changeName.bind(this)
	}
	render() {
		return (
			<div>
				<input type="text" onChange={this.props.changeName}/>
			</div>
		);	
	}
}
